const Header: React.FC = () => {
  return (
    <header className="bg-white shadow-sm">
      <div className="container mx-auto px-4 py-6">
        <h1 className="text-3xl font-bold text-gray-900">AI Product Chatbot</h1>
        <p className="mt-2 text-gray-600">Ask questions about products and suppliers</p>
      </div>
    </header>
  );
};

export default Header;
